import React, { useState } from 'react';
import '../styles/Dashboard.css';

const initialTasks = [
  {
    id: 1,
    title: 'Buy groceries',
    dueDate: '2025-09-10',
    completed: false,
  },
  {
    id: 2,
    title: 'Finish project report',
    dueDate: '2025-09-11',
    completed: false,
  },
  {
    id: 3,
    title: 'Call John',
    dueDate: '2025-09-09',
    completed: true,
  },
];

export default function Dashboard({ username = "Alex", onLogout }) {
  const [tasks, setTasks] = useState(initialTasks);
  const [newTask, setNewTask] = useState('');
  const [dueDate, setDueDate] = useState('');
  const [editingTaskId, setEditingTaskId] = useState(null);
  const [editedTaskTitle, setEditedTaskTitle] = useState('');

  const handleAddTask = () => {
    if (newTask.trim() === '' || dueDate === '') return;
    const newEntry = {
      id: Date.now(),
      title: newTask,
      dueDate,
      completed: false,
    };
    setTasks([newEntry, ...tasks]);
    setNewTask('');
    setDueDate('');
  };

  const handleDelete = (id) => {
    setTasks(tasks.filter((task) => task.id !== id));
  };

  const handleEdit = (id, title) => {
    setEditingTaskId(id);
    setEditedTaskTitle(title);
  };

  const handleSaveEdit = (id) => {
    setTasks(
      tasks.map((task) =>
        task.id === id ? { ...task, title: editedTaskTitle } : task
      )
    );
    setEditingTaskId(null);
    setEditedTaskTitle('');
  };

  const toggleComplete = (id) => {
    setTasks(
      tasks.map((task) =>
        task.id === id ? { ...task, completed: !task.completed } : task
      )
    );
  };

  const today = new Date().toISOString().split('T')[0];

  const todaysTasks = tasks.filter(
    (task) => task.dueDate === today && !task.completed
  );
  const upcomingTasks = tasks.filter(
    (task) => task.dueDate > today && !task.completed
  );
  const completedTasks = tasks.filter((task) => task.completed);

  return (
    <div className="dashboard-container">
      {/* Header */}
      <header className="dashboard-header">
        <h2 className="dashboard-logo">üìù To-Do App</h2>
        <div className="dashboard-user-section">
          <span className="dashboard-username">Welcome, {username}</span>
          <button className="dashboard-logout-button" onClick={onLogout}>Logout</button>
        </div>
      </header>

      {/* Add Task Section */}
      <section className="dashboard-add-task">
        <input
          type="text"
          placeholder="Task title"
          value={newTask}
          onChange={(e) => setNewTask(e.target.value)}
          className="dashboard-input"
        />
        <input
          type="date"
          value={dueDate}
          onChange={(e) => setDueDate(e.target.value)}
          className="dashboard-input"
        />
        <button onClick={handleAddTask} className="dashboard-add-button">Add Task</button>
      </section>

      {/* Task Lists */}
      <div className="dashboard-task-lists">
        <TaskList
          title="Today's Tasks"
          tasks={todaysTasks}
          toggleComplete={toggleComplete}
          handleDelete={handleDelete}
          handleEdit={handleEdit}
          handleSaveEdit={handleSaveEdit}
          editingTaskId={editingTaskId}
          editedTaskTitle={editedTaskTitle}
          setEditedTaskTitle={setEditedTaskTitle}
        />
        <TaskList
          title="Upcoming Tasks"
          tasks={upcomingTasks}
          toggleComplete={toggleComplete}
          handleDelete={handleDelete}
          handleEdit={handleEdit}
          handleSaveEdit={handleSaveEdit}
          editingTaskId={editingTaskId}
          editedTaskTitle={editedTaskTitle}
          setEditedTaskTitle={setEditedTaskTitle}
        />
        <TaskList
          title="Completed Tasks"
          tasks={completedTasks}
          toggleComplete={toggleComplete}
          handleDelete={handleDelete}
        />
      </div>
    </div>
  );
}

function TaskList({
  title,
  tasks,
  toggleComplete,
  handleDelete,
  handleEdit,
  handleSaveEdit,
  editingTaskId,
  editedTaskTitle,
  setEditedTaskTitle,
}) {
  return (
    <div className="dashboard-task-list">
      <h3>{title}</h3>
      {tasks.length === 0 ? (
        <p className="dashboard-empty-message">No tasks</p>
      ) : (
        tasks.map((task) => (
          <div key={task.id} className="dashboard-task-item">
            <input
              type="checkbox"
              checked={task.completed}
              onChange={() => toggleComplete(task.id)}
            />
            {editingTaskId === task.id ? (
              <>
                <input
                  type="text"
                  value={editedTaskTitle}
                  onChange={(e) => setEditedTaskTitle(e.target.value)}
                />
                <button onClick={() => handleSaveEdit(task.id)}>Save</button>
              </>
            ) : (
              <>
                <span
                  className={`dashboard-task-title ${
                    task.completed ? 'completed' : ''
                  }`}
                >
                  {task.title} ({task.dueDate})
                </span>
                <button onClick={() => handleEdit(task.id, task.title)}>
                  Edit
                </button>
              </>
            )}
            <button onClick={() => handleDelete(task.id)}>Delete</button>
          </div>
        ))
      )}
    </div>
  );
}
